item.value:
 proc get_master_slaveness { arg_port } {
 set MasterSlaveness [get_param_value $arg_port "Port Properties" MasterSlaveness ]
 return $MasterSlaveness
 }

 proc get_category { arg_port } {
 set Category [get_param_value $arg_port "Port Properties" Category ]
 return $Category
 }

 proc get_priority { arg_port } {
 set Priority [get_param_value $arg_port "Extra Parameters" priority ]
 return $Priority
 }

 proc get_default_slave { arg_port } {
 set default_slave [get_param_value $arg_port "Extra Parameters" default_slave ]
 return $default_slave
 }

 proc get_data_width { arg_port } {
 set data_width [get_param_value $arg_port:protocol "Protocol Common Parameters" data_width]
 return $data_width
 }

 #Check if all priorities of connected initiators to a node are between 0 and nr of initiators -1
 proc check_arbiter_priorities { arg_node } {

 set portList [list_ports $arg_node ]

 set slaveMemoryPortsList {}

 #find all node ports that are slave ports and of category memory
 foreach port "$portList" {
 set ms [ get_master_slaveness $arg_node/$port ]
 set cat [ get_category $arg_node/$port ] 
 if { $ms == "Slave" && $cat == "Memory"} {
 lappend slaveMemoryPortsList $port
 }
 }

 set listLength [llength $slaveMemoryPortsList]

 #check that the priority of every port is smaller than 
 #the number of ports - 1.

 set prioMax [ expr $listLength - 1 ]

 foreach port "$slaveMemoryPortsList" {
 set prio [ get_priority $arg_node/$port]
 if { $prio > $prioMax } {
 error "
ERROR :Arbitration priority out of bounds. 

 - The arbitration priority of port '$arg_node/$port' is '$prio'.
 - Change the priority to a value between '0' and the number of initiators minus one, in this case '$prioMax'.

"
 }
 }
 }
 #end of check_arbiter_priorities

 proc check_datawidth { arg_node } {

 set portList [list_ports $arg_node ]

 set memoryPortsList {}

 #find all node ports that are of category memory
 foreach port "$portList" {
 set cat [ get_category $arg_node/$port ] 
 if { $cat == "Memory"} {
 lappend memoryPortsList $port
 }
 }

 set bus_data_width [get_param_value $arg_node "Extra properties" /all_encaps/BUSWIDTH]

 foreach port "$memoryPortsList" {
 set port_data_width [get_data_width $arg_node/$port]
 if { $bus_data_width != $port_data_width } {
 error "
ERROR: data_width must be the same for all ports and must be equal to BUSWIDTH parameter on bus node. 

 - data_width of port $port is $port_data_width.
 - BUSWIDTH set on the bus node is $bus_data_width.

"
 } 
 }
 }

 proc check_default_slave { arg_node } {
 set portList [list_ports $arg_node ]

 set masterMemoryPortsList {}

 #find all node ports that are master ports and of category memory
 foreach port "$portList" {
 set ms [ get_master_slaveness $arg_node/$port ]
 set cat [ get_category $arg_node/$port ] 
 if { $ms == "Master" && $cat == "Memory"} {
 lappend masterMemoryPortsList $port
 }
 }

 set listLength [llength $masterMemoryPortsList]
 set default_slave_found 0

 foreach port "$masterMemoryPortsList" {
 set default_slave [ get_default_slave $arg_node/$port]
 if { $default_slave == "true" } {
 if { $default_slave_found == 1 } {
 error "
ERROR: Only one default slave possible. 
"
 }
 set default_slave_found 1
 }
 }
 }

 proc check_delay_params { arg_node } {

 set defaultBusMode [get_param_value $arg_node "Extra properties" /all_encaps/default_bus_mode]

 if { $defaultBusMode == "AT" } {

 set requestAcceptDelay [ get_param_value $arg_node "Extra properties" /all_encaps/timing_parameters/request_accept_delay]

 if { $requestAcceptDelay == 0 } {
 ::pct::display_warning_message "/all_encaps/timing_parameters/request_accept_delay should be set to non-zero value on $arg_node in AT mode"
 } else {
 #::pct::display_info_message "/all_encaps/timing_parameters/request_accept_delay is set to $requestAcceptDelay on $arg_node in AT mode"
 }

 set responseAcceptDelay [ get_param_value $arg_node "Extra properties" /all_encaps/timing_parameters/response_accept_delay]

 if { $responseAcceptDelay == 0 } {
 ::pct::display_warning_message "/all_encaps/timing_parameters/response_accept_delay should be set to non-zero value on $arg_node in AT mode"
 } else {
 #::pct::display_info_message "/all_encaps/timing_parameters/response_accept_delay is set to $responseAcceptDelay on $arg_node in AT mode"
 }

 set arbitrationDelay [get_param_value $arg_node "Extra properties" /all_encaps/timing_parameters/arbitration_delay]

 if { $arbitrationDelay == 0 } {
 ::pct::display_warning_message "/all_encaps/timing_parameters/arbitration_delay should be set to non-zero value on $arg_node in AT mode"
 } else {
 #::pct::display_info_message "/all_encaps/timing_parameters/arbitration_delay is set to $arbitrationDelay on $arg_node in AT mode"
 }

 }

 }

 #main funcitonality
 check_arbiter_priorities [current_instance] 
 check_default_slave [current_instance]
 check_datawidth [current_instance]
 check_delay_params [current_instance]
